void addProjToGroup()
{
    ProjTable   projTable;
    container   data;

    if (projValEmplProjTable.GroupId)
    {
        projTable = projTable_NotGroup_DS.getFirst(1);

        if (!projTable)
        {
            data    += projTable_NotGroup.ProjId;
        }
        else
        {
            while (projTable)
            {
                data += projTable.ProjId;
                projTable = projTable_NotGroup_DS.getNext();
            }
        }

        ProjValTableServer::addProjToEmplProj(data,projValEmplProjTable.GroupId);
    }
}

